import React, { Component } from 'react';
import "./NavBar.css";
import Grid from '@material-ui/core/Grid';
import fblogo from "../../images/logo.png";
import home from "../../images/home.svg";
import pages from "../../images/pages.svg";
import watch from "../../images/watch.svg";
import market from "../../images/market.svg";
import friends from "../../images/groups.svg";

class NavBar extends Component {
    constructor(props) {
        super(props);
        this.state = {  }   
    }
    render() { 
        return ( 
            <div>
                <Grid container >
                    <Grid item xs ={3}>
                        <div className="navbar__leftbar">
                            <img className="navbar__logo" src={fblogo} width="40px"/>
                            <input className="navbar__search" type="text" placeholder="Search Facebook" />
                        </div>
                    </Grid>
                    <Grid item xs ={6} style={{ "backgroundColor": "red"}}>
                        <div className="navbar__nav">
                            <img className="navbar__image" src={home} />
                        </div>
                        <div className="navbar__nav">
                            <img className="navbar__image" src={pages} />
                        </div>
                        <div className="navbar__nav">
                            <img className="navbar__image" src={watch} />
                        </div>
                        <div className="navbar__nav">
                            <img className="navbar__image" src={market} />
                        </div>
                        <div className="navbar__nav">
                            <img className="navbar__image" src={friends} />
                        </div>
                    </Grid>
                    <Grid item xs ={3}>
                        right
                    </Grid>
                </Grid>
            </div> 
        );
    }
}

export default NavBar;
